package main

import (
	"bytes"
	"context"
	"encoding/base64"
	"flag"
	"fmt"
	"log"
	"os"
	"time"

	"golang.org/x/sys/unix"

	"github.com/faiface/beep/effects"

	"github.com/faiface/beep/wav"

	"github.com/faiface/beep"

	"github.com/faiface/beep/speaker"
)

// Converted select click files to base64
const Perc_Clap_hi_wav_b64 = ``
const Perc_Clap_lo_wav_b64 = ``
const Perc_Tamb_A_lo_wav_b64 = ``

const (
	TempoIncrease = 10
	TempoAdjMin   = 20
	// TempoAdjMax anything above this is speedcore and you probably couldn't hear the clicks over your playing
	TempoAdjMax = 200
)

type config struct {
	// tempo beats per minute. The tempo of a measure.
	tempo           int
	beatsPerMeasure int // 4/(4)
	// mrate increase tempo by some factor every specified measures
	mrate int
	// tempoKeys increase or decrease tempo using keyboard keys. Example: "12" increases tempo when 1 is pressed and decreases tempo when 2 is pressed.
	tempoKeys      string
	volumeIncrease float64
	countIn        int
}

func main() {
	cfg := config{
		tempo:           120,
		beatsPerMeasure: 4,
	}

	flag.IntVar(&cfg.tempo, "tempo", 60, "specify the tempo in beats per minute")
	flag.IntVar(&cfg.beatsPerMeasure, "tsig", 4, "specify the beats per measure")
	flag.IntVar(&cfg.mrate, "mrate", 0, "increase tempo every 'mrate' measures up to a tempo of 200 max")
	flag.StringVar(&cfg.tempoKeys, "tempo-keys", ", ", "increase or decrease tempo using keyboard keys. Example: \"12\" increases tempo when 1 is pressed and decreases tempo when 2 is pressed")
	flag.Float64Var(&cfg.volumeIncrease, "vol", 0, "increase/decrease volume logarithmically, pos or neg")
	flag.IntVar(&cfg.countIn, "c", 1, "count in this many measures")
	flag.Parse()

	clicks, err := initClicks(&cfg)
	if err != nil {
		log.Println(err.Error())
		return
	}

	ctx, cancel := context.WithCancel(context.Background())

	// keypress tempo change and quit, only supported on systems with termios
	ostate, kbTempoChan, err := handleKeypress(cancel, cfg.tempoKeys)
	if err != nil {
		log.Println("Error: unable to make raw term.", err.Error())
	} else {
		defer reset(int(os.Stdin.Fd()), ostate)
	}

	// interval per beat based on BPM
	tick := newTicker(cfg.tempo)
	defer tick.Stop()

	nBeat := 0
	measure := 1 - cfg.countIn
	kbNewTempo := cfg.tempo
loop:
	for {
		select {
		case <-ctx.Done():
			break loop
		case t := <-tick.C:
			if nBeat == cfg.beatsPerMeasure {
				nBeat = 0
				measure += 1
				if measure > 0 && cfg.mrate > 0 && ((measure+1)%cfg.mrate) == 0 && cfg.tempo < TempoAdjMax {
					kbNewTempo = cfg.tempo + TempoIncrease
				}
				if kbNewTempo != cfg.tempo {
					tick.Stop()
					cfg.tempo = kbNewTempo
					tick = newTicker(cfg.tempo)
				}
			}
			var tik beep.StreamSeeker
			if measure < 1 {
				fmt.Printf("%s [%d] Count In %d.%d\n", t.Format("15:04:05.000000"), cfg.tempo, measure, nBeat)
				tik = clicks.countIn.Streamer(0, clicks.countIn.Len())
			} else {
				fmt.Printf("%s [%d] Beat %d.%d\n", t.Format("15:04:05.000000"), cfg.tempo, measure, nBeat)
				tik = clicks.beats[nBeat].Streamer(0, clicks.beats[nBeat].Len())
			}
			speaker.Play(tik)
			nBeat += 1
		case rateAdj := <-kbTempoChan:
			var newTempo int
			if rateAdj == KeypressDecrTempo {
				newTempo = kbNewTempo - TempoIncrease
			} else {
				newTempo = kbNewTempo + TempoIncrease
			}
			if newTempo >= TempoAdjMin && newTempo <= TempoAdjMax {
				kbNewTempo = newTempo
			}
		}
	}
}

// Clicks sounds for clicks and count-in
type Clicks struct {
	beats   []*beep.Buffer
	countIn *beep.Buffer
}

func initClicks(cfg *config) (*Clicks, error) {
	bsnd1, _ := base64.StdEncoding.DecodeString(Perc_Clap_hi_wav_b64)
	beat1Buffer, format, err := loadSound(bsnd1, cfg.volumeIncrease+0.75) // slight increase on beat1 volume
	if err != nil {
		return nil, err
	}
	bsnd2, _ := base64.StdEncoding.DecodeString(Perc_Clap_lo_wav_b64)
	beat2Buffer, _, err := loadSound(bsnd2, cfg.volumeIncrease)
	if err != nil {
		return nil, err
	}
	cisnd, _ := base64.StdEncoding.DecodeString(Perc_Tamb_A_lo_wav_b64)
	countInBuffer, _, err := loadSound(cisnd, cfg.volumeIncrease)
	if err != nil {
		return nil, err
	}

	beats := make([]*beep.Buffer, 0)
	for i := 0; i < cfg.beatsPerMeasure; i++ {
		buf := beat2Buffer
		if i == 0 {
			buf = beat1Buffer // beat 2+ tick
		}

		beats = append(beats, buf)
	}

	// shortening sampleRate.N at higher BPMs makes for a smoother stream of beats
	if err := speaker.Init(format.SampleRate, format.SampleRate.N(time.Second/time.Duration(cfg.tempo))); err != nil {
		log.Println(err.Error())
		return nil, err
	}

	clicks := Clicks{
		beats:   beats,
		countIn: countInBuffer,
	}
	return &clicks, nil
}

func loadSound(src []byte, vol float64) (*beep.Buffer, beep.Format, error) {
	br := bytes.NewReader(src)
	ostr, format, err := wav.Decode(br)
	if err != nil {
		return nil, beep.Format{}, err
	}
	volume := &effects.Volume{
		Streamer: ostr,
		Base:     2,
		Volume:   vol,
		Silent:   false,
	}
	streamer := beep.ResampleRatio(4, 1, volume)
	buffer := beep.NewBuffer(format)
	buffer.Append(streamer)
	_ = ostr.Close()

	return buffer, format, nil
}

func newTicker(tempo int) *time.Ticker {
	f := float32(tempo) / float32(60) // beats per second
	d := float32(time.Second) / f     // when each beat should occur
	println("BPM: tempo", tempo, "dur", time.Duration(d))
	return time.NewTicker(time.Duration(d))
}

const (
	KeypressIncrTempo = iota
	KeypressDecrTempo
)

func handleKeypress(cancel context.CancelFunc, keys string) (*unix.Termios, chan int, error) {
	tempoKeys := make([]byte, 2)
	tempoKeys[0] = keys[0] // decrease
	tempoKeys[1] = keys[1] // increase

	ostate, err := makeRaw(int(os.Stdin.Fd()))

	kbTempo := make(chan int)
	go func() {
		var b = make([]byte, 1)
		for {
			_, err := os.Stdin.Read(b) // read one byte from raw terminal
			if err != nil {
				log.Println(err.Error())
				cancel()
				return
			}
			log.Println("read keypress", b[0])
			switch b[0] {
			case tempoKeys[0]:
				kbTempo <- KeypressDecrTempo
			case tempoKeys[1]:
				kbTempo <- KeypressIncrTempo
			case 'q':
				cancel()
				return
			default:
				log.Println("unhandled keypress", b[0])
			}
		}
	}()
	return ostate, kbTempo, err
}

// our own b/c we don't want to muck with output or signal reception
func makeRaw(fd int) (*unix.Termios, error) {
	termios, err := unix.IoctlGetTermios(fd, unix.TIOCGETA)
	if err != nil {
		return nil, err
	}

	oldState := *termios

	// This attempts to replicate the behaviour documented for cfmakeraw in
	// the termios(3) manpage.
	termios.Iflag &^= unix.IGNBRK | unix.BRKINT | unix.PARMRK | unix.ISTRIP | unix.INLCR | unix.IGNCR | unix.ICRNL | unix.IXON
	//termios.Oflag &^= unix.OPOST
	termios.Lflag &^= unix.ECHO | unix.ECHONL | unix.ICANON | /*unix.ISIG |*/ unix.IEXTEN
	termios.Cflag &^= unix.CSIZE | unix.PARENB
	termios.Cflag |= unix.CS8
	termios.Cc[unix.VMIN] = 1
	termios.Cc[unix.VTIME] = 0
	if err := unix.IoctlSetTermios(fd, unix.TIOCSETA, termios); err != nil {
		return nil, err
	}

	return &oldState, nil
}

func reset(fd int, termios *unix.Termios) error {
	return unix.IoctlSetTermios(fd, unix.TIOCSETA, termios)
}
